import React from 'react';
import './App.css';
import Users from './Users/users';
import { BrowserRouter } from 'react-router-dom';

function App() {
  return (
	<BrowserRouter>
		<div className="App">
			<Users />
		</div>
	</BrowserRouter>
  );
}

export default App;
